import React from 'react';

import {Navigate, Outlet} from 'react-router-dom'

const useAuth=()=>{
    return true
}
// @ts-ignore
const  PrivateRoute=({component }) =>{

  const auth=useAuth()


  return auth? component : <Navigate to="/login"/>
}

export default PrivateRoute;
